import React from "react";
import Sketch from "react-p5";

export function SketchEx() {
let x = 50;
let y = 50;

setup = (p5, parent) => {
 p5.createCanvas(700, 500).parent(parent);
 p5.background(0);

}
draw = p5 => {
 p5.ellipse(x, y, 70, 70);
 x++;
}


 return <Sketch setup={setup} draw={draw} />
}
